import styles from './Header.module.scss'

function Header() {
	return (
		<header className={styles.wrapper}>
			<div className={styles.logo}>
				<svg>

				</svg>
			</div>

			<div className={styles.profileButton}>

			</div>
		</header>
	)
}

export default Header;
